import ReactDOM from "react-dom";
import "./App.css";

function Header() {
  return (
    <header>
      <h1>Frigus</h1>
    </header>
  );
}

function Main() {
  return (
    <sectiontitle>
      <h1>My Fridge</h1>
    </sectiontitle>
  );
}

function Footer(props) {
  return (
    <footer>
      <h1>Copyright {props.year} </h1>
      <h1>Contact info</h1>
    </footer>
  );
}

function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer year={new Date().getFullYear()} />
    </div>
  );
}

